import React from 'react'
import Head from 'next/head'
import {Â NextPage } from 'next'
import Cover from '../../components/Cover/Cover'
import Layout from '../../components/UI/Layout/Layout'
import Content from '../../components/Content/Content'

const css = require('./index.module.css')

const Home: NextPage = (): JSX.Element => {

    React.useEffect(() => {
        if ("serviceWorker" in navigator) {
            navigator.serviceWorker.register("/sw.js")
                .catch(error => {
                    console.log('error while registering serviceWorker', error)
                })
        } else {
            console.log('serviceWorker not supported.')
        }   
    }, [])

    return (
        <React.Fragment>
            <Head>
                <title>Portfolio</title>
                <meta charSet="UTF-8" />
                <meta name="description" content="Portfolio page" />
                <meta name="keywords" content="Joona Joenpolvi, joonajo, react, typescript, nextjs, portfolio," />
                <meta name="author" content="Joona Joenpolvi" />
                <meta name="viewport" content="width=device-width, initial-scale=1.0" />
            </Head>
            <Layout>
                <Cover />
                <Content />
            </Layout>
        </React.Fragment>
    )
}
export default Home
